import React from "react";
import AppLayout from "../components/AppLayout";
import { Row, Col, Carousel } from "antd";

const Home = () => {
  return (
    <AppLayout>
      <div>
        <Row gutter={[24, 16]}>
          <Col span={24}></Col>
        </Row>
      </div>
    </AppLayout>
  );
};

export default Home;
